import "../css/nopage.css"

const NoPage = () => {
    return (
      <div class="container-fluid">
        <div class="row">
          <div>
            <h1 id="404__header1">Far out!</h1>
            <h2 id="404__header2">We're not sure how you got here...</h2>
            <h2>But you may be lost in cyberspace</h2>
            
            <button class="404__button">Return Home</button>
          </div>
        </div>
    </div>
    )
  };
  
  export default NoPage;
